FileJs.prototype.fromParentSearch = function () {
  const instance = this;
  const { ea } = this;
  window.addEventListener("message", async (e) => {
    try {
      const data = JSON.parse(e.data);
      if (typeof data.mode === "string") {
        if (data.mode === "search" && typeof data.value === "string") {
          const value = data.value;
          if (value === '') {
            instance.fileLoad(instance.path, "none").catch((err) => { console.log(err); });
          } else {
            instance.fileLoad(value, "entire").catch((err) => { console.log(err); });
          }
        }
      }
    } catch {}
  });
}

FileJs.prototype.fileSearchEvent = function () {
  const instance = this;
  const { ea, totalContents } = this;
  const { searchInput } = this;
  searchInput.addEventListener("keypress", async function (e) {
    try {
      if (e.key === "Enter") {
        const value = this.value.trim().replace(/[\=\?\\\/\+\&]/gi, '');
        window.postMessage(JSON.stringify({ mode: "search", value }), "*");
      }
    } catch (e) {
      console.log(e);
    }
  })
}

